package dto;

public class Category {
	private int cano;
	private String caname;
	
	public Category() {
		// TODO Auto-generated constructor stub
	}

	public Category(int cano, String caname) {
		super();
		this.cano = cano;
		this.caname = caname;
	}

	public int getCano() {
		return cano;
	}

	public void setCano(int cano) {
		this.cano = cano;
	}

	public String getCaname() {
		return caname;
	}

	public void setCaname(String caname) {
		this.caname = caname;
	}
	
	
	
	
	
}
